classes.content:
self .FdVirtualGrid > .innerScrollContainer > div:hover {
	background: transparent; 
}
self .FdVirtualGrid > div > .selected {
	background-color: transparent;
}

self .FdVirtualGrid > div >.selected .matrixItem{
	border:1px solid rgb(46, 89, 189);
	color: rgb(46, 89, 189);
}

self .FdVirtualGrid > div .matrixItem{
	color: #777E90;
}

self button[role="tab"] {
	font-size: 24px !important;
	font-weight: 600 !important;
	line-height: normal !important;
	letter-spacing: 0em ;
	text-align: left ;
	margin-right: 50px !important;
	color: #B2B6C6;
}
self button[data-headlessui-state="selected"] {
	color: #2E59BD;
}
self button[data-headlessui-state="selected"]:after {
	background-color: #2E59BD;
}
self div:nth-child(2):not([class]) {
	height: calc(100% - 52px);
}

